import './App.css';
import React from 'react'
import {BrowserRouter, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter >
      <Routes>
        <Route path='/dogs' element={<VendingMachine />} />
      </ Routes>
    </ BrowserRouter >
    </div>
  );
}

export default App;
